    "title": "",
    "text": "Swedbank Pay Checkout allows your customers to be identified by Swedbank Pay, enabling existing Swedbank Pay Checkout users to pay with their favorite payment methods in just a few simple steps. Prerequisites To start integrating Swedbank Pay Checkout, you need the following: HTTPS enabled web server. Agreement that includes Swedbank Pay Checkout. Obtained credentials (merchant Access Token) from Swedbank Pay through Swedbank Pay Admin. Please observe that Swedbank Pay Checkout encompass both the consumer and paymentmenu scope. fdfd Introduction To get started with Swedbank Pay Checkout, you should learn about its different components and how they work together. Swedbank Pay Checkout consists of two related, but disconnected concepts: Checkin and Payment Menu. Checkin identifies the consumer in our Consumer API and Payment Menu authorizes the payment with our Payment Menu API. The next step is to Capture the payment. You can either capture the total amount, or do a part-capture (as described under After Payment). Connect these steps and you have Swedbank Pay Checkout. While Checkin is a necessary component to store personal information and access features like storing cards, it is not a mandatory step for the Checkout process to work. If the payer is from a country where we currently don’t support Checkin, or if he or she opts not to store their data, that’s fine. The Payment Menu can still be used as a guest. Below, you will see a sequence diagram showing the sequence of a Swedbank Pay checkout. Note that in this diagram, the Payer refers to the merchant front-end (website) while Merchant refers to the merchant back-end. sequenceDiagram participant Consumer participant Merchant participant SwedbankPay as Swedbank Pay participant 3rdParty rect rgba(238, 112, 35, 0.05) note left of Consumer: Checkin Consumer -&gt;&gt;+ Merchant: Start Checkin Merchant -&gt;&gt;+ SwedbankPay: POST /psp/consumers deactivate Merchant SwedbankPay --&gt;&gt;+ Merchant: rel:view-consumer-identification ① deactivate SwedbankPay Merchant --&gt;&gt;- Consumer: Show Checkin on Merchant Page Consumer -&gt;&gt;+ Consumer: Initiate Consumer Seamless View (open iframe) ② Consumer -&gt;&gt;+ SwedbankPay: Show Consumer UI page in iframe ③ deactivate Consumer SwedbankPay -&gt;&gt;- Consumer: Consumer identification process activate Consumer Consumer -&gt;&gt;+ SwedbankPay: Consumer identification process deactivate Consumer SwedbankPay --&gt;&gt;- Consumer: show consumer completed iframe activate Consumer Consumer -&gt;&gt; Consumer: EVENT: onConsumerIdentified (consumerProfileRef) ④ deactivate Consumer end rect rgba(138, 205, 195, 0.1) activate Consumer note left of Consumer: Payment Menu Consumer -&gt;&gt;+ Merchant: Initiate Purchase deactivate Consumer Merchant -&gt;&gt;+ SwedbankPay: POST /psp/paymentorders (paymentUrl, consumerProfileRef) deactivate Merchant SwedbankPay --&gt;&gt;+ Merchant: rel:view-paymentorder deactivate SwedbankPay Merchant --&gt;&gt;- Consumer: Display Payment Menu on Merchant Page activate Consumer Consumer -&gt;&gt; Consumer: Initiate Payment Menu Seamless View (open iframe) Consumer --&gt;&gt;+ SwedbankPay: Show Payment UI page in iframe deactivate Consumer SwedbankPay -&gt;&gt;+ Consumer: Do payment logic deactivate SwedbankPay Consumer -&gt;&gt; SwedbankPay: Do payment logic deactivate Consumer opt Consumer perform payment out of iFrame activate Consumer Consumer -&gt;&gt; Consumer: Redirect to 3rd party Consumer -&gt;&gt;+ 3rdParty: Redirect to 3rdPartyUrl URL deactivate Consumer 3rdParty --&gt;&gt;+ Consumer: Redirect back to paymentUrl (merchant) deactivate 3rdParty Consumer -&gt;&gt; Consumer: Initiate Payment Menu Seamless View (open iframe) Consumer -&gt;&gt;+ SwedbankPay: Show Payment UI page in iframe deactivate Consumer end SwedbankPay --&gt;&gt; Payer: Payment status alt If payment is completed activate Consumer Consumer -&gt;&gt; Consumer: Event: onPaymentCompleted Consumer -&gt;&gt;+ Merchant: Check payment status deactivate Consumer Merchant -&gt;&gt;+ SwedbankPay: GET &lt;paymentorder.id&gt; deactivate Merchant SwedbankPay -&gt;&gt;+ Merchant: rel: paid-paymentorder deactivate SwedbankPay opt Get PaymentOrder Details (if paid-paymentorder operation exist) activate Consumer deactivate Consumer Merchant -&gt;&gt;+ SwedbankPay: GET rel: paid-paymentorder deactivate Merchant SwedbankPay --&gt;&gt; Merchant: Payment Details deactivate SwedbankPay end end opt If payment is failed activate Consumer Consumer -&gt;&gt; Consumer: Event: OnPaymentFailed Consumer -&gt;&gt;+ Merchant: Check payment status deactivate Consumer Merchant -&gt;&gt;+ SwedbankPay: GET {paymentorder.id} deactivate Merchant SwedbankPay --&gt;&gt;+ Merchant: rel: failed-paymentorder deactivate SwedbankPay opt Get PaymentOrder Details (if failed-paymentorder operation exist) activate Consumer deactivate Consumer Merchant -&gt;&gt;+ SwedbankPay: GET rel: failed-paymentorder deactivate Merchant SwedbankPay --&gt;&gt; Merchant: Payment Details deactivate SwedbankPay end end activate Merchant Merchant --&gt;&gt;- Consumer: Show Purchase complete opt PaymentOrder Callback (if callbackUrls is set) activate Consumer deactivate Consumer SwedbankPay -&gt;&gt; Merchant: POST Payment Callback end end rect rgba(81,43,43,0.1) activate Merchant note left of Consumer: Capture Merchant -&gt;&gt;+ SwedbankPay: rel:create-paymentorder-capture deactivate Merchant SwedbankPay --&gt;&gt;- Merchant: Capture status note right of Merchant: Capture here only if the purchased&lt;br/&gt;goods don't require shipping.&lt;br/&gt;If shipping is required, perform capture&lt;br/&gt;after the goods have shipped.&lt;br&gt;Should only be used for &lt;br&gt;PaymentInstruments that support &lt;br&gt;Authorizations. end Explanations Under, you see a list of notes that explains some of the sequences in the diagram. Checkin ① rel: view-consumer-identification is a value in one of the operations, sent as a response from Swedbank Pay to the Merchant. ② Initiate Consumer Seamless View (open iframe) creates the iframe. ③ Show Consumer UI page in iframe displays the checkin form as content inside of the iframe. ④ onConsumerIdentified (consumerProfileRef) is an event that triggers when the consumer has been identified, and delivers a field consumerProfileRef as a reference to be used in the payment menu. Payment Menu ⑤ Authorize Payment is when the payer has accepted the payment. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam volutpat, nisl vel facilisis sollicitudin, libero augue laoreet massa, quis imperdiet eros turpis ut arcu. Maecenas vitae fringilla sem. Nunc libero libero, eleifend a pulvinar id, imperdiet sed massa. Donec dictum tortor sed orci consequat elementum. Sed sollicitudin finibus libero eu maximus. Aliquam bibendum ipsum id arcu aliquam, vitae laoreet sapien pretium. Mauris non commodo neque. Sed vel leo orci. Implement Checkin",
    "tags": "",
    "url": "/checkout/v2/"
